import React, { Component } from "react";
import "./style.css";

function ToSign(props) {
    return (
        <button type="button" onClick={props.onClick} className="logbutton">Log In</button> 
    )
}

class Loginbox extends Component (props) {
    render () {
        let login = (
            <div className="box">
            <div className="buttonshere">
                <ToSign onClick={props.onSign} />
                <button type="button" className="logbutton" id="not">Sign Up</button>
            </div>  
            <input type="text" className="username" name="username" placeholder="username"></input>
            <br></br>
            <input type="text" className="username" name="password" placeholder="password"></input>
            <br></br>
            <button type="button" className="logingo">Log In</button>
        </div>
        );

        let signup = (
            <h1>signup</h1>
        );
    
        if (! this.props.isSignUp) {
            return (
                <div>
                    {login}
                </div>
        
            ) 
        } else {
            return (
                <div>
                    {signup}
                </div>
            )
        }

      
    }
  }


  export default Loginbox
